class Account {
  String namauser;
  String nohp;
  int uang;
  String foto;
  String deskripsi;
  final List<Alamat> alamat;
  final List<CartItem> cart;

  void updateAccount({
    String? foto,
    String? namauser,
    String? deskripsi,
    String? nohp,
    List<Alamat>? alamat,
    List<CartItem>? cart,
  }) {
    if (foto != null) this.foto = foto;
    if (namauser != null) this.namauser = namauser;
    if (deskripsi != null) this.deskripsi = deskripsi;
    if (nohp != null) this.nohp = nohp;
  }

  Account({
    required this.foto,
    required this.namauser,
    required this.nohp,
    required this.uang,
    required this.deskripsi,
    required this.alamat,
    required this.cart,
  });
}

class CartItem {
  final String gambar;
  final String itemName;
  final int harga;
  int itemCount;
  final String namatoko;
  bool isSelected;

  CartItem({
    required this.gambar,
    required this.itemName,
    required this.harga,
    required this.itemCount,
    required this.namatoko,
    this.isSelected = false,
  });
}

class Alamat {
  final String nama;
  final String detail;
  final double ongkir;
  final String nohp;

  Alamat(this.nama, this.detail, this.ongkir, this.nohp);
}

